@Deɴɴy Olɨver࿓ Acaba com a vida então, pois todo e qualquer ser vivo há de causar mudanças macro ou micro no ambiente que podem ser interpretadas como prejudiciais.
Na verdade, mesmo acontecimentos inorgânicos caem nisso, pois um meteoro caindo na Terra ou mesmo uma erupção de vulcão não é algo que precisa de seres vivos para causar um impacto.
Mas existimos, e somos conscientes, então a melhor forma de prosseguir é evoluir de forma a nos relacionarmos de maneira sábia com as coisas, pois a própria existência em si já é suficientemente mutável para que tal ódio à mudanças seja ininteligível.

